import { TextField } from "@material-ui/core";

export default function KeywordCheck(){
    const styles = {
        border:'1px solid black',
        width:'1510px',
        height:'700px'
      };
      const styles1 = {
        border:'1px solid black',
        width:'1510px',
        height:'90px'
      };

    return(
        <>
            <div style={styles}>
                <div style={styles1}>
                    <div style={{height:'80px',backgroudColor:'sky'}}>
                        검색: <TextField id="outlined-basic" label="Outlined" variant="outlined"/>
                    </div>
                </div>
            </div>
        </>
    );
}
